// Extrair informa√ß√µes do input
const inputData = items[0].json;
const respostas = inputData.body;


//Formatar n√∫mero Internacional
function formatarTelefone(telefone) {
  const telefoneLimpo = telefone.replace(/[^\d]/g, '');

  let ddi;
  let ddd;
  let telefoneFormatado;

  // Verificar se o telefone come√ßa com "55" antes de format√°-lo
  if (telefoneLimpo.startsWith('55')) {
    ddi = telefoneLimpo.slice(0, 2);
    ddd = telefoneLimpo.slice(2, 4);
    if (parseInt(ddd, 10) > 28) {
      telefoneFormatado = ddi + ddd + telefoneLimpo.slice(-8);
    } else {
      telefoneFormatado = ddi + ddd + telefoneLimpo.slice(-9);
    }
  } else {
    // Se o DDI for diferente de 55, manter o n√∫mero como est√°
    telefoneFormatado = telefoneLimpo;
  }

  return telefoneFormatado;
}


// Fun√ß√£o para obter a data atual menos 15 dias no formato brasileiro (dia/m√™s/ano)
function getDataMenos15Dias() {
  const dataAtual = new Date();
  dataAtual.setDate(dataAtual.getDate() - 15);
  const dia = dataAtual.getDate().toString().padStart(2, '0');
  const mes = (dataAtual.getMonth() + 1).toString().padStart(2, '0'); // +1 porque o m√™s come√ßa em 0
  const ano = dataAtual.getFullYear();
  return `${ano}-${mes}-${dia}`;
}

// UTMS
const utmContent = $node["sala_secreta"].json["body"]["utm_content"] || '';
const utmSource = $node["sala_secreta"].json["body"]["utm_source"] || '';
const utmCampaign = $node["sala_secreta"].json["body"]["utm_campaign"] || '';
const utmMedium = $node["sala_secreta"].json["body"]["utm_medium"] || '';
const utmTerm = $node["sala_secreta"].json["body"]["utm_term"] || '';

function formatarInstagram(username) {
  if (username) {
    // Remover espa√ßos em branco extras
    let usernameFormatado = username.trim();

    // Remover o s√≠mbolo @ caso exista no in√≠cio
    if (usernameFormatado.startsWith('@')) {
      usernameFormatado = usernameFormatado.slice(1);
    }

    // Converter para min√∫sculas
    usernameFormatado = usernameFormatado.toLowerCase();

    return usernameFormatado;
  }
  return '';
}


// Fun√ß√£o para extrair as UTMs do objeto JSON
function extractUTMs(json) {
  const utmParams = {};

  function searchUTMs(obj) {
    for (const key in obj) {
      if (key.startsWith('utm_')) {
        utmParams[key] = obj[key];
      } else if (typeof obj[key] === 'object') {
        searchUTMs(obj[key]);
      }
    }
  }

  searchUTMs(json);

  return utmParams;
}

// Extrair as UTMs do objeto JSON de entrada
const utms = extractUTMs(inputData);

// Fun√ß√£o para formata√ß√£o de emails
function formatarEmail(email) {
  // Remover espa√ßos em branco extras
  const emailSemEspacos = email.trim();

  // Converter para min√∫sculas
  const emailFormatado = emailSemEspacos.toLowerCase();

  return emailFormatado;
}

// Fun√ß√£o para formata√ß√£o de nomes
function formatarNome(nome) {
  if (nome) {
    const palavras = nome.trim().split(/\s+/);

    const palavrasMinusculas = ['de', 'dos', 'da', 'e', 'do', 'das', 'di', 'du', 'o', 'a', 'u'];

    for (let i = 0; i < palavras.length; i++) {
      const palavraAtual = palavras[i].toLowerCase();
      if (i === 0 || i === palavras.length - 1 || !palavrasMinusculas.includes(palavraAtual)) {
        palavras[i] = palavraAtual.charAt(0).toUpperCase() + palavraAtual.slice(1);
      } else {
        palavras[i] = palavraAtual;
      }
    }

    return palavras.join(" ");
  }
  return '';
}

// Fun√ß√£o para remover todas as aspas e par√™nteses de um texto
function removerAspasEParenteses(texto) {
    // Substitui todas as ocorr√™ncias de aspas ("") por nada
    let textoSemAspas = texto.replace(/"/g, '');
    // Substitui todas as ocorr√™ncias de par√™nteses () por nada
    textoSemAspas = textoSemAspas.replace(/\([^()]*\)/g, '');
    return textoSemAspas;
}


// Data da aplica√ß√£o em milissefundos
const dataAtualEmMilissegundos = new Date().getTime();

// INFORMA√á√ïES PESSOAIS
const nome = formatarNome($node["sala_secreta"].json["body"]["Nome"]) || "";

const telefone = formatarTelefone($node["sala_secreta"].json["body"]["Whatsapp"]) || '';

const email = formatarEmail($node["sala_secreta"].json["body"]["E-mail"]) || "";

const instagram = formatarInstagram($node["sala_secreta"].json["body"]["Instagram"]) || '';

// Montar o objeto de output
const output = {
 "Nome do Cliente": nome,
 "E-mail do Cliente": email,
 "Telefone do Cliente - Formato BC": '+' + telefone,
 "Telefone do Cliente - Formato Z-API": telefone,
  instagram,
  utm_content: utmContent,
  utm_source: utmSource,
  utm_campaign: utmCampaign,
  utm_medium: utmMedium,
  utm_term: utmTerm,
  data_ultima_quinzena: getDataMenos15Dias(),
  data_aplicacao: dataAtualEmMilissegundos
};

return [output];

